      out.write("        <div class=\"row\">\r\n");
      out.write("\t\t\t<div class=\"col-lg-12 text-center\">\r\n");
      out.write("          \t\t<h3>공공도서관 서비스 가치평가 모델 개발 및 소프트웨어 구축 과제</h3>\r\n");
      out.write("          \t\t<h3 class=\"text-muted\"><small>Modeling the Values of Public Library Services and Software Development</small></h3>\r\n");
      out.write("                <div class=\"space\"></div>\r\n");
      out.write("\t\t\t</div>\r\n");
      out.write("      \t\t<div class=\"row\">\r\n");
      out.write("\t\t\t\t<div class=\"col-md-8 col-md-offset-2\">\r\n");
      out.write("\t\t\t\t\t<p>2012년 ACRL(미국 대학 및 연구도서관 협회)은 도서관의 10대 핵심 이슈 중 하나로 ‘도서관 가치 알리기(Communicating value)’를 선정한 바 있다. \r\n");
      out.write("\t\t\t\t\t\t이는 도서관의 가치를 알리고 이를 통해 지역사회에서 변화와 소통에 주도적인 역할을 주문하는 것이다. 도서관이 지역사회와 소통하기 위해서는 무엇보다 올바른 평가를 통한 가치의 발견이 선행되어야 함은 물론이다.</p>\r\n");
      out.write("      \t \t\t\t<p>그간 도서관에서 수행한 평가는 이용자의 만족도 조사 혹은 서비스 산출 평가(Output evaulation) 위주로 되어 있어 지역사회 내에서 도서관이 만들어내는 변화와 성과를 충분히 보여주지 못하여 도서관이 가진 가치에 비해 \r\n");
      out.write("      \t \t\t\t\t상대적으로 낮은 인식을 받아왔다. 또한 내부적으로도 도서관에 축적된 데이터를 평가에 다양하게 활용할 수 있음에도 불구하고 단순 기술통계로 사용하고 있어 도서관 데이터 활용의 효율성을 제고할 필요가 있는 상황이다.</p>\r\n");
      out.write("      \t \t\t\t<p>따라서 본 연구는 공공도서관의 가치를 계량적으로 제시할 수 있는 성과 평가(Outcome evaluation) 모델을 개발하기 위해 도서관에서 기존에 축적한 데이터를 활용하여 도서관의 가치 평가 지표를 설계하고 지표를 \r\n");
      out.write("      \t \t\t\t\t측정하는 것을 목적으로 한다. 본 목적을 달성하기 위해서 구체적으로는 공공도서관의 다양한 서비스를 다차원으로 분석하고, 공공도서관의 데이터를 활용한 지표를 개발한 후 로직모델(Logic model)을 바탕으로 \r\n");
      out.write("      \t \t\t\t\t평가 프레임워크를 개발한다. 이를 바탕으로 ‘LibOutcomes software’를 개발하여 도서관의 성과와 가치를 보여줄 수 있는 평가도구로 활용하고자 한다.</p>\r\n");
      out.write("      \t\t\t\t<p>본 연구를 통해 다음과 같은 효과를 얻을 수 있을 것으로 기대한다.</p>\r\n");
